for ns in [names, surnames]:
    clean = []
    for word in ns:
        # remove surnames that end with ic and ić
        if word[-2:].lower() == ('ić' or 'ic'):
            continue
        else:
            # capitalize first letter
            clean.append(word.title())

    # insert the list to the set
    clean = set(clean)
    # convert the set to the list
    clean = (list(clean))
    # sort ABC
    clean = sorted(clean)
    # get the print
    if ns == names:
        # open a (new) file to write (not append)
        outF = open("names_clean.txt", "w")
        for n in clean:
            outF.write(n)
            outF.write('\n')
        outF.close()
    else:
        # open a (new) file to write (not append)
        outF = open("surnames_clean.txt", "w")
        for n in clean:
            outF.write(n)
            outF.write('\n')
        outF.close()


